import React from 'react';
import { Container, Row, Col } from 'reactstrap';




export default class Skills_Comp extends React.Component {

  render() {
    return (
        <div style={{color: this.props.color, justifyContent:'center', alignItems:'center'}}>
          <Container>
            <Row>
              <Col>1 of 2</Col>
              <Col>2 of 2</Col>
            </Row>
            <Row>
              <Col>1 of 3</Col>
              <Col>2 of 3</Col>
              <Col>3 of 3</Col>
            </Row>
          </Container>
      </div>
    );
  }
}
